import React from 'react'

export default function GetTodos() {
    return (
        <div className='page'>
            <div className='container'>
                <h2>Get Todo's</h2>
            </div>
            <button className='type-button' value='GetTodos'>Get Todo's</button>
        </div>
    )
}
